import React from 'react';
// import logo from '../images/logo.svg'; how to import photos; code: src={logo}
import './Home';
import '../App';
//import { render } from "react-dom";
//import { Link, Router } from "@reach/router"

class Navbar extends React.Component {
  render() {
    return (
      <div className='smallHeader'>
        <div></div>
        <div></div>
        <div></div>
      </div>
    );
  }
}

class Projects extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      'clicked': false
    }
  }  // boilerplate cod

  render() {
    // Added a link here
    return (
      <div>
        <Navbar changePage={this.changePage} selected={this.props.selected}/>
        <h1>Projects baby!</h1>
        <p>{this.props.projects.length}</p>
        <p>{this.props.id}</p>
        <p>{this.props.selected}</p>
      </div>
    );
  }
}

export default Projects;
